import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Fill in the sign-up form
    await page.waitForSelector('input[placeholder="First name"]');
    await page.fill('input[placeholder="First name"]', 'John');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_fill_first_name.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_fill_first_name.png'));

    await page.fill('input[placeholder="Last name"]', 'Doe');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_fill_last_name.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_fill_last_name.png'));

    await page.fill('input[placeholder="Mobile number or email"]', 'john.doe@example.com');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_fill_email.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_fill_email.png'));

    await page.fill('input[placeholder="New password"]', 'SecurePassword123');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_fill_password.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_fill_password.png'));

    // Select gender (assuming the first radio button is selected)
    await page.click('input[type="radio"]:nth-of-type(1)');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_select_gender.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_select_gender.png'));

    // Click the Sign Up button
    await page.click('button:contains("Sign Up")');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_click_sign_up.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_click_sign_up.png'));

    // Verify task completion by checking for a success message or redirection
    const successMessage = await page.waitForSelector('text=Check your email for a confirmation link', { timeout: 5000 });
    const extractedData = {
      message: await successMessage.textContent()
    };

    return {
      success: true,
      action: "Created an event with basic details",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

